import React from "react";
import FiveDays from "../components/fiveDays";
import { Col, Container, Row } from "react-bootstrap";
const Home = () => {
  return (
    <Container>
      <Row>
        <Col>
          <FiveDays style={{ display: flex }} />
        </Col>
      </Row>
    </Container>
  );
};

export default Home;
